import React from "react";
import Link from "next/link";

export default function Header() {
  return (
    <nav className="flex items-center justify-between flex-wrap p-6 border">
      <div className="flex items-center flex-shrink-0 text-indigo-700 hover:text-white mr-6">
        <span className="font-semibold text-xl tracking-tight">
          <Link href="/">
            <a>Darts... Right Now</a>
          </Link>
        </span>
      </div>
    </nav>
  );
}
